    @content;
  }
}

@mixin for-tablet-portrait-up {
  @media (min-width: 600px) {
    @content;
  }
}

@mixin for-tablet-landscape-up {
  @media (min-width: 900px) {
    @content;
  }
}

@mixin max-for-tablet-landscape-up {
  @media (max-width: 900px) {
    @content;
  }
}

@mixin for-desktop-up {
  @media (min-width: 1120px) {
    @content;
  }
}

@mixin for-big-desktop-up {
  @media (min-width: 1800px) {
    @content;
  }
}

@mixin transicao {
  transition: background-color 2s ease-out;
}

@mixin buttonDefault($background, $color) {
  background-color: $background;
  color: $color;
  border: none;
  text-align: center;
  display: block;
  text-transform: uppercase;
  font-weight: 700;
  padding: 16px 36px;
  width: calc(100% - 30%);
  &:hover {
    background-color: $secondary;
  }
}

sources.assets/scss/components/_breadcrumb.scss:
.breadcrumb {
  border-bottom: 1px solid #e1e1e1;
  width: 100%;
  .row {
    display: flex;
    justify-content: center;
    align-items: center;
    height: 48px;

    @include for-desktop-up {
      justify-content: start;
    }

    ul {
      display: flex;
      li {
        margin: 0px 0px;
        a {
          font-weight: 700;
          font-size: 14px;
          color: #b0b0b0;
          &:hover {
            color: $secondary;
          }
        }
        ::after {
          content: ">";
          width: 20px;
          margin: 0 6px;
          padding: 0 6px 0 10px;
          text-align: center;
        }
      }
      :last-child :after {
        display: none;
      }
    }

    .current {
      color: $text;
    }
  }
}

